import React from 'react'

const Lists = ({movieList,setMovieList}) => {
  return (
    <div>
        <table>
          <thead>
            <tr>
              <th>id</th>
              <th>제목</th>
              <th>poster</th>
              <th>영화 개봉일</th>
              <th>평점</th>
            </tr>
          </thead>
          <tbody>
          {movieList.map((movie) => (
            <div key={movie.id}>
                <img src={`${movie.posterPath}`}/>
                {movie.id}
                {movie.title}
                {movie.releaseDate}
                {movie.average}
            </div>

          ))}
          </tbody>
        </table>
      </div>
  )
}
export default Lists;
